import React from 'react'

const CatButton = (props) => {

    const inButtonHandler = (event) => {
        // event.target.className = "selected"
        this.props.selectHandler(event)
    }

    return(
        <button onClick={inButtonHandler} >
            {props.name}
        </button>
    )
}



export default CatButton
